import React from 'react';
import styled from 'styled-components';

const MyInfoArticle = styled.article`
  border: 1px solid red;
`;
const MySummonerImage = styled.img``;

const MyInfo = () => {
  return (
    <MyInfoArticle>
      <MySummonerImage />
      <div></div>
    </MyInfoArticle>
  );
};

export default MyInfo;
